    <ol class="breadcrumb">
      <li class="breadcrumb-item"><a href="#">Home</a></li>
      {/* TODO: implement getting deck name here */}
      <li class="breadcrumb-item"><a href="#">Deck Name</a></li>
      <li class="breadcrumb-item active">Study</li>
    </ol>
    {/* TODO: get deck name here */}
    <h2>Study</h2>
    <Card />
  </div>;

}

export default Study;
